s($,"aQL","aqC",()=>{var q="Nace en Mairena del Alcor, Sevilla, en el a\xf1o 1993. Comienza sus estudios musicales a la edad de 8 a\xf1os en el Conservatorio Profesional de M\xfasica Francisco Guerrero de Sevilla, donde los finaliza con premio extraordinario en la especialidad de fagot.\n\nContin\xfaa su formaci\xf3n academica en el Conservatorio Superior de M\xfasica de Castilla y Le\xf3n con los profesores \xc1lvaro Prieto, Guillermo Salcedo y Carlos Taranc\xf3n, acabando sus estudios superiores con sobresaliente en el a\xf1o 2017. Durante sus a\xf1os de conservatorio realiza Masterclass con fagotistas como Guillaume Santana, Mor Biron y Marco Postingel.\n\nComplementa sus actividades acad\xe9micas con proyectos de orquestas j\xf3venes como la Orquesta Joven de Extremadura, Orquesta Joven de Andaluc\xeda, Fundaci\xf3n Baremboim-Said y la National Youth Orchestra de Holanda.\n\nComo experiencia profesional ha sido fagot coosolista de la Orquesta Sinf\xf3nica de Tenerife, Orquesta de C\xf3rdoba, Orquesta de Extremadura y Orquesta Ciudad de Melilla. Complementa su formaci\xf3n profesional con el M\xe1ster de Formaci\xf3n del Profesorado y el M\xf3dulo de formaci\xf3n Orquesta de la Fundaci\xf3n Baremboim-Said.\n\nDesde el a\xf1o 2022 es directora de la Agrupaci\xf3n Musical de Vincios, encarg\xe1ndose de las 4 agrupaciones de la asociaci\xf3n (pequebanda, banda infantil, banda xuvenil y la Agrupaci\xf3n Musical de Vincios) adem\xe1s de los grupos de lenguaje musical, actividad que compagina con conciertos de c\xe1mara y orquesta como fagotista. Desde su comienzo en la direcci\xf3n de banda es alumna del prestigioso director de bandas holand\xe9s Marcel van Bree.",p="maestro_vincios.jpeg"
return A.b([A.xN(q,"Mar\xeda Garc\xeda Bustos",p),A.xN(q,"Maestro de Alvarenga",p),A.xN("Rodolfo Maia nasceu na Maia, em Janeiro de 1982.\n\nEstudou Clarinete, Fagote e Saxofone com os professores Luciano Machado, Carlos Canhoto, M\xf3nica Pais, Robert Glassburner, Francisco Ferreira, Jean-Marie Londeix, Arno Bornkamp, Alfonso Padilla e Jacob Ter Veldhuis nos Conservat\xf3rios de M\xfasica da Maia e do Porto e na Escola Superior de M\xfasica e Artes do Espet\xe1culo do Porto.\n\nTocou com a Banda de M\xfasica de Moreira da Maia, Orquestras de Saxofones do Porto e de Jovens M\xfasicos de Ponte de Lima e com os projetos \u201cLets Groove Big band\u201d, \u201cOutbreak\u201d, \u201cGnose\u201d e \u201cGran Morsa\u201d, o quarteto de saxofones \u201cSax4Fun!\u201d, assim como, com a Big Band de Gondomar, Orquestra Ritmos Ligeiros (Trofa), Uni\xe3o Musical Paramense (Espinho), Banda de M\xfasica de Riba D\u2019Ave (V.N. Famalic\xe3o), Banda Musical de Gondomar, Banda de M\xfasica da Cidade de Espinho e com o cantor popular \u201cLu\xeds Manuel\u201d;\n\nIniciou os seus estudos na \xe1rea de dire\xe7\xe3o de banda com o maestro Jacinto Montezo, prosseguindo com os maestros Lu\xeds Clemente, Bert Appermont, Carlos Amarelinho, Paulo Ramos, Jaime Branco, Jacob de Haan, Ant\xf3nio Saiote, Jos\xe9 Ignacio Petit, Jos\xe9 Rafael Pascual Vilaplana, Marcelo Jardim, Jean-Marc Burfin, Hadri\xe1n \xc1vila, Steven Bryant e Verena Moesenbichler-Bryant, tralhando atualmente (desde 2015) com o maestro Paulo Martins, no curso de forma\xe7\xe3o cont\xednua para maestros, da BCA_Band Conducting Academy;\n\nDirigiu a OLB3m - Orquestra Ligeira da Banda de M\xfasica de Moreira da Maia (2008-2010), Banda da Sociedade Filarm\xf3nica Louri\xe7alense \u2013 Pombal (2009), Banda Musical de Cabreiros \u2013 Braga (2010-2014), Tuna Acad\xe9mica do ISMAI_Instituto Superior da Maia (2013), Filarm\xf3nica Ressurrei\xe7\xe3o de Mira (2013-2015), Filarm\xf3nica Verdi Cambrense \u2013 Vouzela,(2017-2022), dirigindo atualmente (desde Novembro de 2022) a Banda S. Crist\xf3v\xe3o de Rio Tinto.\n\nObteve o 2.o Pr\xe9mio no Concurso Nacional de Maestros inserido no Est\xe1gio Nacional da Orquestra de Sopros de Esposende, em 2013; Faz parte da organiza\xe7\xe3o do Concurso Internacional de Bandas CIB \u2013 Filarmonia D\u2019Ouro, desde a sua 1.a edi\xe7\xe3o; e \xe9 membro associado da WASBE \u2013 World Association for Symphonic Bands and Ensembles.\n\nLeciona atualmente as classes de Saxofone nas Escolas de M\xfasica \u201c7 Notas\u201d e \u201cAqui h\xe1 m\xfasica!\u201d Como sax performer faz anima\xe7\xe3o de eventos, agenciado pelas empresas \u201cFunBox\u201d e \u201cDJVox\u201d, para al\xe9m de acompanhar a banda da cantora brasileira Naiara Queiroz;\n\nParalelamente, licenciou \u2013 se em Engenharia Civil pelo Instituto Polit\xe9cnico de Bragan\xe7a, desenvolvendo atualmente a sua atividade profissional na \xe1rea da Ac\xfastica e da Certifica\xe7\xe3o de Edif\xedcios.","Rodolfo Maia","maestro_rio_tinto.jpg")],A.ak("u<xM>"))})
s($,"aQt","aqw",()=>{var q="Foi no ano 1979, cando Xulio Costas Davila e Guillermo Costas Valverde crearon a primeira escola de m\xfasica da parroquia de Vincios, no concello de Gondomar. Ese proxecto faise realidade no ano 1982, coa fundaci\xf3n da Asociaci\xf3n Agrupaci\xf3n Musical de Vincios, na que est\xe1 integrada a banda de m\xfasica, sendo o seu primeiro Presidente D. N\xe9stor Gonz\xe1lez Vilaboa. O Concerto de presentaci\xf3n da Banda foi o d\xeda de San Pedro do ano 1983 en Vincios no Colexio p\xfablico Serra-Vincios baixo a Direcci\xf3n do seu primeiro Director D. Valentin Davila Costas co pasodobre Manolo Soto.\n\nNo ano 1996 D. Telmo Costas toma o relevo do primeiro director da banda, papel que levar\xeda a cabo ata o ver\xe1n do ano 2000. Nese momento e ata outubro de 2014 a agrupaci\xf3n est\xe1 baixo a batuta de D. Juan Luis Costas \xc1lvarez. Durante eses anos detaca o terceiro premio acadado na secci\xf3n primeira do Certame Provincial de Pontevedra en 2005 e o terceiro premio no Certame Galego de Bandas de M\xfasica Populares en 2012.\n\nEntre novembro de 2014 e xu\xf1o de 2018, o director da Banda de M\xfasica Agrupaci\xf3n Musical de Vincios e da Escola foi D. Francisco Valc\xe1rcel Pi\xf1eiro collendo o relevo D. Adri\xe1n Vi\xf1as Alonso ata ver\xe1n de 2022.\n\nDende setembro de 2022, a banda e a escola est\xe1n dirixidas por Dna. Mar\xeda Garc\xeda Bustos.\n\nNo programa anual de actividades, cont\xe9mplase a participaci\xf3n da banda en festivais, concertos de intercambios culturais, concertos do Plan cultural da Deputaci\xf3n Provincial de Pontevedra, as\xed como asistir a celebraci\xf3ns populares.",p="photo_vincios.png"
return A.b([A.xN(q,"Agrupaci\xf3n Musical de Vincius",p),A.xN(q,u.P,p),A.xN('A Banda S. Crist\xf3v\xe3o de Rio Tinto, nasceu em Janeiro de 1937, sob a reg\xeancia de Jos\xe9 Neves (Saramago), como Banda Nova de Rio Tinto. A Banda Marcial S. Crist\xf3v\xe3o de Rio Tinto tornou-se uma das mais conceituadas Bandas de M\xfasica da \xe9poca, na regi\xe3o Norte do nosso pa\xeds. Em 1971, os associados conseguiram comprar um terreno na Rua de Santa Luzia, para edifica\xe7\xe3o da nova sede da associa\xe7\xe3o (actual edif\xedcio sede), a qual acabou por ser inaugurada em Abril de 1971.\n\nA Banda S. Crist\xf3v\xe3o de Rio Tinto \u2013 designa\xe7\xe3o adoptada em Outubro de 2005 \u2013 faz da m\xfasica uma parte substancial da vida dos seus cerca de 60 m\xfasicos.\n\nReflexo do que melhor sabe fazer, m\xfasica, tem tido convites que permitem \xe0 Banda a sua apresenta\xe7\xe3o, quer cumprindo as suas fun\xe7\xf5es enquanto Banda Filarm\xf3nica nas romarias de todo o pa\xeds e Guardas de Honra a entidades oficiais, quer na participa\xe7\xe3o em Encontros de Bandas, quer, ainda, na organiza\xe7\xe3o regular do seu pr\xf3prio Encontro de Bandas da Cidade de Rio Tinto \u2013 Concertos de Ver\xe3o desde 2006, quer, por fim, ao mais alto n\xedvel, com concertos Corais-Sinf\xf3nicos ou participa\xe7\xf5es em conceituados Festivais.\n\nUm dos expoentes m\xe1ximos da hist\xf3ria recente da Banda foi a participa\xe7\xe3o no \u201cCertamen Internacional de Bandas de M\xfasica \u2013 Ciudad de Valencia\u201d em 2007, um dos mais prestigiados a n\xedvel europeu e a selec\xe7\xe3o desta banda para a participa\xe7\xe3o no 16th World Music Contest de Kerkrade \u2013 Holanda, o mais prestigiado concurso de bandas a n\xedvel mundial, onde foi nomeada banda do dia (2009). Em territ\xf3rio Nacional foi participando em v\xe1rios festivais e encontros de bandas, entre os quais o famoso "Festival de Bandas Filarmonia ao Mais Alto N\xedvel", no qual foi descrita como exibidora de uma \u201catitude serena e segura\u201d durante toda a sua \u201catua\xe7\xe3o de muito bom n\xedvel\u201d, \u201csegura e eficaz\u201d, conseguindo uma \u201cpresta\xe7\xe3o condizente com o seu estatuto de Banda de Qualidade, que tem gosto no que faz!\u201d.\n\nPelas suas Bodas de Diamante, foi agraciada com b\xean\xe7\xe3o papal de Sua Santidade o Papa Bento XVI, tendo sido a primeira banda a receber tal agrado do meio eclesi\xe1stico, e missivas do Exmo. Reverend\xedssimo Bispo do Porto D. Manuel Clemente e do P\xe1roco da freguesia de Rio Tinto, Exmo. Sr. Padre Ant\xf3nio Vidinha. Teve ainda o reconhecimento por parte do Presidente da Rep\xfablica, Exmo. Professor Doutor An\xedbal Cavaco Silva, atrav\xe9s do of\xedcio 01317, datado de 23-02-2012, congratulando esta institui\xe7\xe3o pelo seu trabalho nos seus 75 anos de exist\xeancia.\n\nNo seu 76o Anivers\xe1rio em Janeiro de 2013 recebeu a Medalha de M\xe9rito (Grau Ouro) da C\xe2mara Municipal de Gondomar pelo reconhecido trabalho no \xe2mbito Cultural e Musical, tendo sido tamb\xe9m\n\nagraciada com uma condecora\xe7\xe3o Honrosa por parte da Junta de Freguesia de Rio Tinto, que j\xe1 considerou a BSCRT como o \u201cconservat\xf3rio de M\xfasica\u201d da cidade de Rio Tinto. N\xe3o menos importante foi a carta de reconhecimento \xe0 Banda, enviada pela Sua Alteza Real Dom Duarte de Bragan\xe7a, elogiando o trabalho musical e o associativismo pela BSCRT desenvolvido.\n\nOrganiza anualmente alguns Concertos tem\xe1ticos, como o \u201cConcerto de Natal\u201d, Concerto de Ano Novo\u201d, \u201cConcerto do Dia da M\xe3e\u201d, \u201cConcerto de Anivers\xe1rio\u201d, entre outros.\n\nPossui uma escola de m\xfasica com cerca de 40 alunos, de v\xe1rias idades, com proveni\xeancias de diversos estratos sociais que ensina e incentiva o gosto pela m\xfasica, para al\xe9m de preencher os tempos livres dos jovens e promover a renova\xe7\xe3o cont\xednua da Banda. Assinala-se tamb\xe9m a incr\xedvel ades\xe3o de que a Banda tem sido alvo por parte das camadas mais jovens do concelho, fazendo da sua escola de m\xfasica um elemento fundamental quer na forma\xe7\xe3o desses mesmos jovens, quer no refor\xe7o dos quadros da pr\xf3pria banda cuja m\xe9dia de idades ronda os 23 anos, tornando-os activos v\xe1lidos nesse \xe2mbito.\n\nPossui ainda um Quinteto de Metais \u201cJarms Brass\u201d, um \u201cEnsemble de Saxofones\u201d e uma \u201cOrquestra Juvenil\u201d. Participam em concertos a convite de algumas Associa\xe7\xf5es, Juntas de Freguesia e C\xe2mara Municipal.\n\nPublica trimestralmente a sua Magazine \u201cAbufa na Gaita\u201d que d\xe1 a conhecer a atividade da Associa\xe7\xe3o, bem como algumas curiosidades musicais.\n\nAssume em 2019 a dire\xe7\xe3o mais jovem da hist\xf3ria da BSCRT com uma aposta na moderniza\xe7\xe3o e informatiza\xe7\xe3o da associa\xe7\xe3o, o que se tornou uma mais valia na vitalidade da mesma. Em 2022, por ocasi\xe3o da comemora\xe7\xe3o da Eleva\xe7\xe3o de Rio Tinto a Cidade, a BSCRT foi a entidade coletiva escolhida para ser agraciada com a Medalha de M\xe9rito da Cidade.\n\nV\xe1rios maestros foram passando pela dire\xe7\xe3o da Banda, cada um deixando a sua marca. Atualmente, Rodolfo Maia \xe9, desde Novembro de 2022, o Maestro e Director art\xedstico da Banda S. Crist\xf3v\xe3o de Rio Tinto.',"Banda S. Crist\xf3v\xe3o de Rio Tinto","photo_rio_tinto.jpg")],A.ak("u<xM>"))})
